        <span className="inline-block mb-5">سلام، خوش اومدی</span>
        <p>
          <span className="text-indigo-700 font-MorabbaMedium text-5xl">
            ابوالفضل صادقی
          </span> هستم
        </p>
        <h3 className="mt-5">توسعه دهنده و طراح سایت</h3>
      </div>
    </div>
  );
}
